window.bookSummaryJSON = "<p>To gain his Master Class, John Lee made a deal with the Erethran Empire. Now, the empire has come to collect on the debt, forcing him to appear in their capital after his last fight. Thrown into Galactic politics of a militarized, system-based society, John will have to weigh consequences of the decisions he's been asked to make and confront the warped reality of a system-created empire. When politics, self-interest, and a human's stubbornness collide, the very stars are threatened.&nbsp;</p> <p><i>Stars Asunder</i> is book nine of the System Apocalypse, the best-selling LitRPG fantasy and space opera series.</p>"; 
